        require(_callerCanMakeWriteMulticall(msg.sender), 'Not Authorized.');

        WriteCall memory call;
        results = new bytes[](calls.length);

        bool success;
        bytes memory result;

        for(uint256 i = 0; i < calls.length; i++) {
            call = calls[i];
